import React, {useState} from 'react';
import axios from 'axios';
import {useForm} from 'react-hook-form';
import { API_URL } from '../../constants';


const FormCreate = ({refreshList}) => {

    //adding state to the functional component through useState React Hook and create form data
    const [formData, setFormData] = useState({ 
        id: 0,
        name: '',
        email: '',
        select: '',
        raceOption: '',
        comments: '',
    })

    //using components of the useForm react hook to validate the inputs of the form
    const {
        register, 
        handleSubmit,
        formState: {errors},
        reset,
    } = useForm();

    


    //creating the onSubmit function to submit the form to the backend
    const onSubmit = (formData) => {
            //using axios to call to the backend to create or post a new entry
            axios.post(API_URL, formData) 
                .then((response) => {
                    //logging the data to the console 
                    console.log(response.data); 
                    reset();
                    refreshList();
                    alert('Form submitted successfully');
                })
                .catch((error) => {
                    console.error(error);
                    alert('An error occurred. Please try again.')
                });
        
    };

    return(
        <form className='form' onSubmit={handleSubmit(onSubmit)}>
            <div className='formField'>
                <label className='label'>Name: </label>
                <input className='input' type='text'{...register('name', {required: 'Name is required'})} ></input>
                {errors.name && <div className='errors'>{errors.name.message}</div>}
            </div>
            <div className='formField'>
                <label className='label'>Email: </label>
                <input className='input'type='text'{...register('email', {required: 'Email is required', pattern: {value: /^\S+@\S+\.\S+$/, message: "Please enter a valid email address"} })} ></input>
                {errors.email && <div className='errors'>{errors.email.message}</div>}
            </div>
            <div className='formField'>
                <label className='label'>Select: </label>
                <select {...register('selectValue', { required: 'Select an option' })} >
                    <option value=''>Do you want your name on your bib?</option>
                    <option value='Yes'>Yes</option>
                    <option value='No'>No</option>
                </select>
                {errors.selectValue && <div className='errors'>{errors.selectValue.message}</div>}
            </div>
            <div className='formField'>
            <label className='label'>Choose a Race: </label>
                <label >
                    <input
                        type="radio"
                        {...register('raceOption', { required: 'Select a race option' })}
                        name="raceOption"
                        value="5k"
                        
                    />
                    5k
                </label>
                <label >
                    <input
                        type="radio"
                        {...register('raceOption', { required: 'Select a race option' })}
                        name="raceOption"
                        value="Half-Marathon"
                        
                    />
                    Half-Marathon
                </label>
                <label >
                    <input
                        type="radio"
                        {...register('raceOption', { required: 'Select a race option' })}
                        name="raceOption"
                        value="Marathon"
                        
                    />
                    Marathon
                </label>
                {errors.raceOption && <div>{errors.raceOption.message}</div>}
            </div>
            <div className='formField'>
                <label className='label'>Comments: </label>
                <textarea className='text-area' name="comments" type='text' {...register('comments', { required: 'Please add any comments' })} value={formData.comments}></textarea>
                {errors.comments && <div>{errors.comments.message}</div>}
            </div>
            <button className='submitButton' type='submit'>Submit</button>
        </form>
    )

}

export default FormCreate;
